XML3D.shaders.register("render-depth", {
    vertex: [
        "attribute vec3 position;",
        "varying vec4 worldPosition;",
        "uniform mat4 modelMatrix;",
        "uniform mat4 modelViewProjectionMatrix;",


        "void main(void) {",
        "   worldPosition = modelMatrix * vec4(position, 1.0);",
        "   gl_Position   = modelViewProjectionMatrix * vec4(position, 1.0);",
        "}"
    ].join("\n"),

    fragment: [
        "varying vec4 worldPosition;",
        "uniform mat4 viewMatrix;",
        "uniform float near, far;",
        "float cameraFarPlusNear = far + near;",
        "float cameraFarMinusNear =far - near;",
        "float cameraCoef = near;",


        "float linearDepth(float d) {",
        "return cameraCoef / (cameraFarPlusNear - (d * cameraFarMinusNear));",
        "}",


        "void main(void) {",
        "float ld=linearDepth(gl_FragCoord.z);",
        "float ndcDepth=(2.0 * gl_FragCoord.z - gl_DepthRange.near - gl_DepthRange.far) /(gl_DepthRange.far - gl_DepthRange.near);",
        "float clipDepth = ndcDepth / gl_FragCoord.w;",
//        "gl_FragColor = vec4((clipDepth * 0.5) + 0.5); ",
        "gl_FragColor = vec4(gl_FragCoord.z);",
        "}"
    ].join("\n"),

    uniforms: {
        far: 10000,
        near: 0.1
    }
});
XML3D.shaders.register("alchemy-ssao", {
    vertex: [
        "attribute vec2 position;",
//        "varying vec2 uv;",
        "void main(void) {",
        "  gl_Position = vec4(position,0.0, 1.0);",
//        "  uv =(vec2( gl_Position.x,  gl_Position.y ) + vec2( 1.0, 1.0 ) ) * 0.5;",
        "}"
    ].join("\n"),

    fragment: [
        "#ifdef GL_ES",
        "precision highp float;",
        "#endif",
        "#define PI  3.14159265",
        "uniform vec2 canvasSize;",
        "uniform sampler2D sNormalTex;",
        "uniform vec2 uRandomTexSize;",
        "uniform sampler2D sRandomNormals;",
        "uniform float radius_alchemy,fieldOfView,epsilon,beta,sigma;",
        "uniform float near, far;",
        "uniform sampler2D sDepthTexture,sPositionTex;",
        "uniform mat4 viewMatrix;",
//        "vec2 uv;",
        "float cameraFarPlusNear = (far + near);",
        "float cameraFarMinusNear =(far - near);",
        "float cameraCoef = 2.0*(near);",


        "const int NUM_SAMPLES = 16;",
        "const int NUM_SPIRAL_TURNS = 5;",

        //linearized the depth
        "float linearDepth(float d) {",
        "return cameraCoef / (cameraFarPlusNear - (d * cameraFarMinusNear));",
        "}",

        "vec3 getPositionWS(vec2 texCoordinate) {",
        "vec3 originWS=texture2D(sPositionTex, texCoordinate).xyz;",
        "return originWS;",
        "}",

        //calculate the offset for next location
        "vec2 tapLocation(int sampleNumber, float spinAngle) {",
        "float alpha = (float(sampleNumber) + 0.5) * (1.0 / float(NUM_SAMPLES));",
        "float angle = alpha * (float(NUM_SPIRAL_TURNS) * 2.0 * PI) + spinAngle;",
        "float radius_alchemy = alpha;",
        "return alpha * vec2(cos(angle), sin(angle));",
        "}",

        "void main(void) {",
        "vec2 uv = (gl_FragCoord.xy / canvasSize.xy);",
        "float ao=0.0;",
        "vec3 wc_position = getPositionWS(uv);",
        "vec4 current_depth_data = texture2D(sDepthTexture, uv);",
        "float linearDepth_texCoord =linearDepth(current_depth_data.x);",
        "vec3 wc_normal = normalize(texture2D(sNormalTex, uv).xyz * 2.0 - 1.0 );",
        "vec2 rand = normalize(texture2D(sRandomNormals, gl_FragCoord.xy / canvasSize*uRandomTexSize).xy * 2.0 - 1.0 );",
        "float random =rand.x;",
        "float diskRadius = radius_alchemy / (viewMatrix * vec4(wc_position, 1.0)).z;",
        "for(int i=0; i < NUM_SAMPLES; i++){",
        "vec2 offset = tapLocation(i, random);",
        "vec2 samplePosition = uv + diskRadius * offset;",
        "vec3 samplePoint = getPositionWS(samplePosition);",
        "vec3 diff = samplePoint - wc_position;",
        "vec3 v = normalize(diff);",
        "float vv = dot(v, v);",
        "float vn = dot(v, wc_normal);",
        "ao += max(0.0, vn - linearDepth_texCoord * beta) / (vv + epsilon);",
        "}",
        "ao *= 2.0 * sigma / float(NUM_SAMPLES);",
        "ao = min(1.0, max(0.0, ao));",
        "gl_FragColor = vec4(vec3(ao),1.0);",
        "}"
    ].
        join("\n"),

    uniforms: {
        canvasSize: [512, 512],
        radius_alchemy: 0.5,
        far: 10,
        near: 1,
        epsilon: 0.01,
        beta: 0.2,
        sigma: 1.0
    },

    samplers: {
        sNormalTex: null,
        sPositionTex: null,
        sRandomNormals: null,
        sDepthTexture: null
    },

    attributes: {
    }
})
;

(function (webgl) {

    //variables to be declared

    var base64RandomNormals = "data:image/png;base64,"

    var OPTION_SSAO_SCALE = "renderer-ssao-scale";
    var OPTION_SSAO_INTENSITY = "renderer-ssao-intensity";
    var OPTION_SSAO_BIAS = "renderer-ssao-bias";
    var OPTION_SSAO_RADIUS = "renderer-ssao-radius";
    /**
     *
     * @param {GLContext} context
     * @param {GLScene} scene
     * @constructor
     *
     */

    //SSAO Render tree implementation
    var MySSAOPass = function (renderInterface, enableSSAO) {
        webgl.BaseRenderTree.call(this, renderInterface);
        var scene = renderInterface.scene;
        scene.addEventListener(webgl.Scene.EVENT_TYPE.LIGHT_STRUCTURE_CHANGED, this.onLightStructureChange.bind(this));
        scene.addEventListener(webgl.Scene.EVENT_TYPE.LIGHT_VALUE_CHANGED, this.onLightValueChange.bind(this));
        scene.addEventListener(webgl.Scene.EVENT_TYPE.SCENE_SHAPE_CHANGED, this.onSceneShapeChange.bind(this));
        scene.addEventListener(webgl.ShaderComposerFactory.EVENT_TYPE.MATERIAL_INITIALIZED, this.onShaderChange.bind(this));
        this._enableSSAO = enableSSAO;
        this.mainPass = null;
        this.createMainPass();
    };

    XML3D.createClass(MySSAOPass, webgl.BaseRenderTree);

    XML3D.extend(MySSAOPass.prototype, {
        onLightStructureChange: function (evt) {
            var light = evt.light;
            if (evt.removed) {
                // TODO: Proper clean up ShadowPass
                light.userData = null;
            }
            else {
                if (light.light.type == "spot")
                    light.userData = this.createLightPass(light)
            }
            this.reassignLightPasses(evt.target);
        },
        onLightValueChange: function (evt) {
            // TODO: Would be great to check of the light position or orientation specifically changed
            // We don't need to invalidate the lightPass otherwise
            if (evt.light.castShadow) {
                evt.light.userData && evt.light.userData.setProcessed(false);
            }
        },
        onSceneShapeChange: function (evt) {
            var scene = evt.target;
            for (var i = 0; i < scene.lights.spot.length; i++) {
                var spotLight = scene.lights.spot[i];
                if (spotLight.castShadow)
                    spotLight.userData && spotLight.userData.setProcessed(false);
            }
        },
        onShaderChange: function (evt) {
            this.reassignLightPasses(evt.target);
        },

        createLightPass: function (light) {
            var context = this.renderInterface.context
            var dimension = Math.max(context.canvasTarget.width, context.canvasTarget.height) * 2;
            var lightFramebuffer = new webgl.GLRenderTarget(context, {
                width: dimension,
                height: dimension,
                colorFormat: context.gl.RGBA,
                depthFormat: context.gl.DEPTH_COMPONENT16,
                stencilFormat: null,
                depthAsRenderbuffer: true
            });
            var lightPass = new webgl.LightPass(this.renderInterface, lightFramebuffer, light);
            lightPass.init(context);
            return lightPass;
        },

        reassignLightPasses: function (scene) {
            var context = this.renderInterface.context;

            this.mainPass.clearLightPasses();
            for (var i = 0; i < scene.lights.spot.length; i++) {
                var spotLight = scene.lights.spot[i];
                this.mainPass.addLightPass("spotLightShadowMap", spotLight.userData);
            }
        },

        createMainPass: function () {
            var outputTarget = this.renderInterface.context.canvasTarget;
            if (this._enableSSAO) {
                var positionPass = this.createVertexAttributePass("render-position");
                var normalPass = this.createVertexAttributePass("render-normal");
                var depthPass = this.createVertexAttributePass("render-depth");
                var ssaoPass = this.createSSAOPass(positionPass.output, normalPass.output, depthPass.output);
                ssaoPass.addPrePass(positionPass);
                ssaoPass.addPrePass(normalPass);
                ssaoPass.addPrePass(depthPass);
                var blurPass = this.createBlurPass(ssaoPass.output);
                blurPass.addPrePass(ssaoPass);
                this._blurPass = blurPass;
                this._ssaoPass = ssaoPass;
                this._positionPass = positionPass;
                this._normalPass = normalPass;
                this._depthPass = depthPass;
                this.mainPass = new webgl.ForwardRenderPass(this.renderInterface, outputTarget, {
                    inputs: {
                        ssaoMap: blurPass.output
                    }
                });
                if (!window.onlyAO) {
                    this.mainPass.addPrePass(blurPass);
                }
            } else {
                this.mainPass = new webgl.ForwardRenderPass(this.renderInterface, outputTarget);
            }
            if (!window.onlyAO) {
                this.mainRenderPass = this.mainPass;
            }
            else {
                this.mainRenderPass = this._blurPass;
            }
        },

        createVertexAttributePass: function (programName) {
            var context = this.renderInterface.context;
            var buffer = new webgl.GLRenderTarget(context, {
                width: context.canvasTarget.width,
                height: context.canvasTarget.height,
                colorFormat: context.gl.RGBA,
                colorType: context.gl.FLOAT,
                depthFormat: context.gl.DEPTH_COMPONENT16,
                stencilFormat: null,
                depthAsRenderbuffer: true
            });
            return new webgl.VertexAttributePass(this.renderInterface, buffer, {
                programName: programName
            });
        },

        createSSAOPass: function (positionBuffer, normalBuffer, depthBuffer) {
            var context = this.renderInterface.context;
            var ssaoBuffer = new webgl.GLRenderTarget(context, {
                width: context.canvasTarget.width,
                height: context.canvasTarget.height,
                colorFormat: context.gl.RGBA,
                depthFormat: context.gl.DEPTH_COMPONENT16,
                stencilFormat: null,
                depthAsRenderbuffer: true
            });

            return new SSAOPass1(this.renderInterface, ssaoBuffer, {

                inputs: {
                    positionBuffer: positionBuffer,
                    normalBuffer: normalBuffer,
                    depthBuffer: depthBuffer
                }
            });
        },

        createBlurPass: function (inputBuffer) {
            var outputSSAO;
            var context = this.renderInterface.context;
            var blurBuffer = new webgl.GLRenderTarget(context, {
                width: inputBuffer.width,
                height: inputBuffer.height,
                colorFormat: context.gl.RGBA,
                depthFormat: context.gl.DEPTH_COMPONENT16,
                stencilFormat: null,
                depthAsRenderbuffer: true
            });
            if (window.onlyAO) {
                outputSSAO = context.canvasTarget;
            }
            else {
                outputSSAO = blurBuffer;
            }

            return new webgl.BoxBlurPass(this.renderInterface, outputSSAO, {
                inputs: {
                    buffer: inputBuffer
                }
            });
        },

        render: function (scene) {
            if (this._enableSSAO) {
                this._positionPass.setProcessed(false);
                this._normalPass.setProcessed(false);
                this._depthPass.setProcessed(false);
                this._ssaoPass.setProcessed(false);
                this._blurPass.setProcessed(false);
            }
            this.mainRenderPass.setProcessed(false);
            webgl.BaseRenderTree.prototype.render.call(this, scene);
        },

        getRenderStats: function () {
            return this.mainPass.getRenderStats();
        }
    });


    //SSAO-render pass Implementation


    var SSAOPass1 = function (renderInterface, output, opt) {
        webgl.BaseRenderPass.call(this, renderInterface, output, opt);
        var context = this.renderInterface.context;
        this._program = context.programFactory.getProgramByName("alchemy-ssao");
        this.randomVectorTexture = this.createRandomVectorTexture(context);
        this.loadRandomVectorImage();
        this._screenQuad = new XML3D.webgl.FullscreenQuad(context);
        this._uniformsDirty = true;
//		if (!this.inputs.positionBuffer)
//			this._positionPass = this.createVertexAttributePass("render-position");
//		if (!this.inputs.normalBuffer)
//			this._normalPass = this.createVertexAttributePass("render-normal");
    };

    XML3D.createClass(SSAOPass1, webgl.BaseRenderPass);

    XML3D.extend(SSAOPass1.prototype, {
        createRandomVectorTexture: function (context) {
            var gl = context.gl;
            var tex = new XML3D.webgl.GLTexture(gl);
            tex.createTex2DFromData(gl.RGBA, 64, 64, gl.RGBA, gl.UNSIGNED_BYTE, {
                wrapS: gl.REPEAT,
                wrapT: gl.REPEAT,
                minFilter: gl.LINEAR,
                magFilter: gl.LINEAR
            });
            tex.isTexture = true;
            return tex;
        },

        loadRandomVectorImage: function () {

            var img = new Image();
            img.src = base64RandomNormals;
            var gl = this.renderInterface.context.gl;
            var texhandle = this.randomVectorTexture.handle;

            img.onload = function () {
                gl.bindTexture(gl.TEXTURE_2D, texhandle);
                gl.texImage2D(gl.TEXTURE_2D, 0, gl.RGBA, gl.RGBA, gl.UNSIGNED_BYTE, img);
            }
        },

        createVertexAttributePass: function (programName) {
            var context = this.renderInterface.context;
            var buffer = new webgl.GLRenderTarget(context, {
                width: context.canvasTarget.width,
                height: context.canvasTarget.height,
                colorFormat: context.gl.RGBA,
                colorType: context.gl.FLOAT,
                depthFormat: context.gl.DEPTH_COMPONENT32,
                stencilFormat: null,
                depthAsRenderbuffer: true
            });
            return new webgl.VertexAttributePass(this.renderInterface, buffer, {
                programName: programName
            });
        },


        render: (function () {
//			if (this._positionPass)
//				this._positionPass.setProcessed(false);
            var inverseProjectionMatrix = XML3D.math.mat4.create();
            var projectionMatrix = XML3D.math.mat4.create();
            var viewMatrix = XML3D.math.mat4.create();
            var inverseViewMatrix = XML3D.math.mat4.create();
            var uniformNames = ["viewMatrix", "inverseViewMatrix", "projectionMatrix", "inverseProjectionMatrix"];
            return function (scene) {
                var gl = this.renderInterface.context.gl;
                var target = this.output;

                target.bind();
                gl.clear(gl.COLOR_BUFFER_BIT | gl.DEPTH_BUFFER_BIT);
                gl.viewport(0, 0, target.getWidth(), target.getHeight());
                gl.enable(gl.DEPTH_TEST);

                this._program.bind();
//                this.updateUniforms();
                this._setNonVolatileShaderUniforms(scene);

                var uniforms = {};
                scene.getActiveView().getProjectionMatrix(projectionMatrix);
                scene.getActiveView().getWorldToViewMatrix(viewMatrix);
                scene.getActiveView().getViewToWorldMatrix(inverseViewMatrix);
                XML3D.math.mat4.invert(inverseProjectionMatrix, projectionMatrix);
                uniforms["projectionMatrix"] = projectionMatrix;
                uniforms["inverseProjectionMatrix"] = inverseProjectionMatrix;
                uniforms["viewMatrix"] = viewMatrix;
                uniforms["inverseViewMatrix"] = inverseViewMatrix;
                this._program.setSystemUniformVariables(uniformNames, uniforms);
                this._screenQuad.draw(this._program);

                this._program.unbind();
                target.unbind();
            }
        }()),

        _setNonVolatileShaderUniforms: (function () {
            var uniformNames = [
                "canvasSize",
                "sNormalTex",
                "sPositionTex",
                "sDepthTexture",
                "far",
                "near",
                "uRandomTexSize",
                "radius_alchemy",
                "radius_vao",
                "radius_hbao",
                "sRandomNormals",
                "epsilon",
                "beta",
                "fieldOfView",
                "sigma",
                "uAngleBias",
                "uIntensity",
                "lower_bound",
                "upper_bound",
                "uScale",
                "uBias",
                "uIntensity",
                "uSampleRadius",
                "uConstVectors",
                "radius_starCraft",
                "strength",
                "offset",
                "falloff",
                "radius_Gauss",
                "gDisplace",
                "intensity",
                "radius_sao"
            ];

            return function (scene) {
                if (!this._uniformsDirty)
                    return;

                var uniforms = {};
                var program = this._program;
                program.bind();
                var target = this.output;
                uniforms["canvasSize"] = [target.width, target.height];
                uniforms["fieldOfView"] = scene.activeView.fieldOfView;
                uniforms["far"] = scene.activeView.getClippingPlanes().far;
                uniforms["near"] = scene.activeView.getClippingPlanes().near;
                uniforms["uRandomTexSize"] = [64, 64];
                uniforms["sNormalTex"] = [this.inputs.normalBuffer.colorTarget.handle];
                uniforms["sRandomNormals"] = [this.randomVectorTexture];
                uniforms["sDepthTexture"] = [this.inputs.depthBuffer.colorTarget.handle];
                uniforms["sPositionTex"] = [this.inputs.positionBuffer.colorTarget.handle];
                //alchemy ssao parameters
                uniforms["radius_alchemy"] = window.radius_alchemy;
                uniforms["epsilon"] = 0.0001;
                uniforms["sigma"] = window.alchemy_sigma;
                uniforms["beta"] = 0.001;
                program.setSystemUniformVariables(uniformNames, uniforms);
                program.unbind();

            }
        })()
    });

    window.addEventListener("load", function () {
        var xml3dElement = document.getElementById("Scene1");
        var renderInterface = xml3dElement.getRenderInterface();
        var ssaoRenderTree = new MySSAOPass(renderInterface, true);
        xml3dElement.addEventListener("load", function a() {
            renderInterface.setRenderPipeline(ssaoRenderTree);
        });
    });

})(XML3D.webgl);


